import React, { Fragment } from "react";
import Contact from "../components/contact/Contact";
import Footer from "../components/footer/Footer";

function Cont() {
  return (
    <Fragment>
      <Contact />
      <Footer />
    </Fragment>
  );
}

export default Cont;
